import React from "react";
import "./SchoolTitle.css";
import { useSelector } from "react-redux";
import { selectOpenSchool } from "../features/schoolSlice";

function SchoolTitle() {
  const selectedSchool = useSelector(selectOpenSchool);
  console.log(selectedSchool);

  return (
    <div className="schoolTitle__container">
      <h1>North High</h1>
    </div>
  );
}

export default SchoolTitle;
